import React, { useState } from "react";
import Arrow_up from "../../asset/arrow_up.png";
import Arrow_down from "../../asset/arrow_down.png";
import Cat from "../../asset/cat.png";
import clsx from "clsx";
import styles from "../NestedList/NestedList.module.scss";

const NestedList5 = () => {
  const [div5, setDiv5] = useState(true);
  const arrow_up_function = () => {
    setDiv5(false);
  };
  const arrow_down_function = () => {
    setDiv5(true);
  };

  return (
    <div className="nestlist1 ">
      <div>
        <div>
        <p className={styles.title}>Others</p>
          {div5 ? (
            <img
              onClick={() => {
                arrow_up_function();
              }}
              src={Arrow_up}
              alt="arrow_up"
            ></img>
          ) : (
            <img
              onClick={() => {
                arrow_down_function();
              }}
              src={Arrow_down}
              alt="arrow_up"
            ></img>
          )}
        </div>
        <div className={clsx(div5 && styles.disappear)}>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>寄信</p>
          </div>

        </div>
      </div>
    </div>
  );
};

export default NestedList5;
